/* Visual Main Swiper ======================= */
.swiper_visual {
  width: 100%;
  height: 100vh;
  overflow: hidden;
  /* 전체 Swiper 영역 CSS 수정 */

  .swiper_visual,
  swiper-container {
    position: relative;
    width: 1660px;

    .swiper-wrapper {
      width: 100%;
      height: 100vh;
    }
  }



  /* Swiper-Silde 내용 CSS 수정 */
  .swiper-slide,
  swiper-slide {
    position: relative;
    text-align: center;
    font-size: 70px;
    overflow: hidden;

    img {
      width: 100%;
      min-width: 1660px;
      height: auto;
      display: block;
    }
    .visual_txt {
      position: absolute;
      left: 150px;
      bottom: 210px;
      height: 50px;
      line-height: 50px;
      font-size: 22px;
      text-align: left;

      h1 {
        color: #fff;
        text-shadow: 2.5px 2.5px 5px #000;
      }
    }
    a {
      display: block;

      input {display: none;}
      label {
        position: absolute;
        left: 150px;
        bottom: 142px;
        width: 180px;
        height: 50px;
        line-height: 50px;
        text-align: center;
        background-color: #ccc;
        font-size: 18px;
        color: #fff;
        border-radius: 30px;
        border: 2px solid #fff;
        background-color: rgba(255, 255, 255, 0.1);
        backdrop-filter: blur(2px);
        cursor: pointer;
        box-shadow: 2px 2px 5px #000;
      }
      label:hover {
        background-color: #002053;
        border: 2px solid #002053;
        transition: 0.3s;
      }
    }
  }


  /* Progress Bar 색상 및 CSS 수정 */
  .swiper-horizontal>.swiper-scrollbar,
  .swiper-scrollbar.swiper-scrollbar-horizontal {
    z-index: 1;
    width: 300px;
    height: 25px;
    bottom: 87px;
    left: 150px;
    border-radius: 5px;
    background-color: rgba(255, 255, 255, 0.1);
    box-shadow: 2px 2px 5px;
  }

  /* Progress Bar Drag 색상 및 CSS 수정 */
  .swiper-scrollbar-drag {
    border-radius: 5px;
    background-color: $PointColor;
  }

  /* Arrow Next 위치 변경 */
  .swiper-button-prev,
  .swiper-rtl .swiper-button-next {
    top: auto;
    left: 540px;
    bottom: 75px;
    color: #fff;
    z-index: 1;
  }

  /* Arrow Prev 위치 변경 */
  .swiper-button-next,
  .swiper-rtl .swiper-button-prev {
    top: auto;
    left: 585px;
    bottom: 75px;
    color: #fff;
    z-index: 1;
  }

  .swiper-button-next:after,
  .swiper-button-prev:after {
    z-index: 1;
    font-size: 25px;
    padding: 5px 12px;
    border-radius: 5px;
    font-weight: bold;
    text-shadow: 3px 3px 5px #000;
  }


  /* Progress 옆 pagination CSS 수정 */
  .swiper-pagination-fraction {
    z-index: 1;
    width: 80px;
    height: 35px;
    text-align: center;
    line-height: 30px;
    font-weight: bold;
    left: 455px;
    bottom: 80px;
    top: auto;
    font-size: 25px;
    color: #fff;
    text-shadow: 3px 3px 5px #000;
  }
}




/* Ranking Swiper ======================= */
.Ranking {
  overflow: hidden;

  .Ranking_box {
