// btn_section ----------------------
.btn_section {
  font-size: 70px;
  font-weight: bold;
  text-align: center;

  /* SNS_box =========== */
  .SNS_box {
    height: 60vh;
    overflow: hidden;

    .SNS_title {
      width: 1660px;
      margin: 0 auto;
      font-size: $TitFont;

      span:first-child {
        width: 50%;
        height: 15vh;
        float: left;
        margin-bottom: 25px;
        text-align: left;
        padding-left: 25px;
        padding-top: 70px;
        box-sizing: border-box;

      }
      span:last-child {
        width: 50%;
        height: 15vh;
        float: right;
        margin-bottom: 25px;
        text-align: right;
        padding-right: 25px;
        padding-top: 70px;
        box-sizing: border-box;

      }
    }


    .SnsSwiper {
      width: 1660px;
      height: 40vh;
      margin: 0 auto;      

      .swiper-wrapper {
        width: 100%;

        .swiper-slide {
          width: 100%;
          height: 40vh !important;
          overflow: hidden;

          .SNS_contentBox {
            display: flex;
          }

          .SnsCotn {
            width: 400px;
            height: 400px;
            margin-right: 20px;
            background-color: red;
            overflow: hidden;

            img {
              width: 100%;
              height: auto;
              display: inline;
              vertical-align: middle;
            }
          }
          .SNS_content7 {
            position: relative;

            img {
              width: 106%;
              margin-top: -43%;
              margin-left: -5%;
            }
          }
          .SnsCotn:last-child {
            margin-right: 0;
          }
        }
      }
      .swiper-pagination-vertical.swiper-pagination-bullets, .swiper-vertical>.swiper-pagination-bullets {
        width: 50px;
        height: 250px;
        padding: 5px;
        box-sizing: border-box;
        border-radius: 10px;
        background-color: rgba(255, 255, 255, 0.5);
        backdrop-filter: blur(5px);
      }
      .swiper-pagination-bullet {
        width: 50px;
        height: 50px;
        background-color: rgba(0,0,0, 0.8);
        border-radius: 0px;
      }

      .swiper-pagination-bullet-active {
        background-color: $PointColor;
      }
      .SNS_custom_bullet {
        height: 50%;
        font-size: 38px;
        padding: 30px 0;
        box-sizing: border-box;
        display: block;
        cursor: pointer;
      }
    }
    }
  /* footer ============ */
  .footer {
    display: flex;
    justify-content: center;
    width: 100%;
    height: 40vh;
    font-size: 12px;
    overflow: hidden;
    background-color: #eee;
    color: #777;

    .footer_box {
      width: 1660px;
      display: flex;
      flex-direction: row;
      flex-wrap: wrap;
      height: 8vh;

      .foot_top {
        width: 100%;
        height: 8vh;

        .ft_log {
          width: 80px;
          padding: 7px 0;
          margin-top: 15px;
          box-sizing: border-box;
          float: left;

          img {
            width: 100%;
            height: auto;
            display: block;
          }
        }
        .ft_SNS {
          display: flex;
          justify-content: space-around;
          width: 200px;
          margin-top: 25px;
          font-size: 20px;
          float: right;
        }
        
      }
    }
    .foot_mid {
      width: 65%;
      background-color: #eee;

      .ft_menu {
        height: 23vh;
        font-weight: normal;

        ul {
          width: 22%;
          float: left;

          li {
            padding: 4px 0;
            text-align: center;
            font-size: 12px;

            a {
              color: #777;
              display: block;
            }
          }
          li:hover a {
            color: $PointColor;
            font-weight: bold;
            transition: 0.3s;
          }
          li:first-child {
            padding-bottom: 7px;
            font-size: 14px;
            font-weight: bold;
            
            a {
              color: #444;
            }
          }
        }
        ul:nth-child(1) {
          margin-left: 2%;
        }
        ul:nth-child(4) {
          width: 30%;
        }
      }

      .ft_info1 {
        height: 7vh;

        .info_spanBox1,
        .info_spanBox2 {
          display: flex;
          justify-content: space-around;
          width: 100%;
          height: 25px;
          margin-bottom: 5px;

          span {
            width: 150px;
            height: 40px;
            text-align: center;
            line-height: 40px;

            a {
              color: #444;
            }
          }
        }
        .info_spanBox2 {
