            text-align: center;
            color: #444
            ;
          }
        }

      }
    }
    .foot_btm {
      width: 35%;
      height: 22vh;
      margin: 0;
      padding: 0;
      padding: 20px;
      box-sizing: border-box;

      .ft_info2 {
        display: flex;
        flex-direction: row;
        flex-wrap: wrap;
        justify-content: space-between;
        height: 15vh;

        span {
          display: inline-block;
          height: 0px;
          text-align: left;
          font-weight: normal;
          letter-spacing: -0.5px;
        }

        span:nth-child(1) {
          padding: 0;
          text-align: left;
        }
        span:nth-child(4) a,
        span:nth-child(8) a {
          font-weight: bold;
          color: $PointColor;
        }
        span:nth-child(7) {
          font-size: 12px;
          font-weight: bold;
          letter-spacing: -0.4px;
          
          a {
            color: $PointColor;
          }
        }
        span:nth-child(9) {
          font-weight: bold;
          color: red;
        }
      }
      .ft_CS_CENTER {
        width: 100%;
        height: 10vh;
        margin-top: 2vh;

        .CS_btn {
          height: 10vh;
          float: left;

          input {
            display: none;
          }

          label {
            display: inline-block;
            width: 150px;
            height: 40px;
            text-align: center;
            line-height: 40px;
            font-size: 14px;
            border-radius: 30px;
            border: 2px solid $PointColor;
            background-color: #fff;
            margin-top: 15px;
            box-shadow: 1.5px 1.5px 3px #000;
            color: #000;
          }
          label:hover {
            background-color: $PointColor;
            color: #fff;
            transition: 0.3s;
          }
